import React, { useState } from 'react';
import DashboardPage from './components/Dashboard';
import HomePage from './components/homepage'; // Assuming the correct file name
import LoginPage from './components/LoginPage';
import MissingGradeFormPage from './components/MissingGradeFormPage';
import HelpAndSupportPage from './components/HelpAndSupportPage';
import InstructorContactPage from './components/InstructorContactPage';
import GradeReportPage from './components/GradeReportPage';

const App = () => {
  const [currentPage, setCurrentPage] = useState('homepage');

  const renderCurrentPage = () => {
    switch (currentPage) {
      case 'dashboard':
        return <DashboardPage />;
      case 'homepage':
        return <HomePage />;
      case 'login':
        return <LoginPage />;
      case 'missing-grades':
        return <MissingGradeFormPage />;
      case 'help-and-support':
        return <HelpAndSupportPage />;
      case 'instructor-contact':
        return <InstructorContactPage />;
      case 'grade-report':
        return <GradeReportPage />;
      // Add more cases for other pages
      default:
        return <HomePage />;
    }
  };

  const handlePageChange = (pageName) => {
    setCurrentPage(pageName);
  };

  return (
    <div className="container">
      <nav>
        <button onClick={() => handlePageChange('dashboard')}>Dashboard</button>
        <button onClick={() => handlePageChange('homepage')}>Home</button>
        <button onClick={() => handlePageChange('login')}>Login</button>
        <button onClick={() => handlePageChange('missing-grades')}>Missing Grades</button>
        <button onClick={() => handlePageChange('help-and-support')}>Help and Support</button>
        <button onClick={() => handlePageChange('instructor-contact')}>Instructor Contact</button>
        <button onClick={() => handlePageChange('grade-report')}>Grade Report</button>
        {/* Add more buttons as needed */}
      </nav>
      <div className="content">
        {renderCurrentPage()}
      </div>
    </div>
  );
}

export default App;
